const Jobs =()=>{
    const [data, setData] = React.useState(null);

    React.useEffect(() => {
      fetch("http://localhost:3001/results")
        .then((res) => res.json())
        .then((data) => setData(data.message));
    }, []);
    return (
        <p>{!data ? "Loading..." : data}</p>
    )
}
export default Jobs
